'use strict';

/**
 * @ngdoc function
 * @name cardkitApp.controller:MainCtrl
 * @description
 * # MainCtrl
 * Controller of the cardkitApp
 */
angular.module('cardkitApp')
  .controller('MainCtrl', function ($scope, $filter, saveSvgAsPng, themeConfig) {

    $scope.config = {
      sizes: [
        {
          name: 'Facebook',
          width: 800,
          height: 370
//          gridsize: 12.15,
        },
        {
          name: 'Twitter',
          default: true,
          width: 650,
          height: 320
//          gridsize: 16.25
        },
        // {
        //   name: 'Video',
        //   width: 640,
        //   height: 360,
        // },
      ],
      themes: themeConfig,
      output: {
        scale: 2,
        editable: {
          scale: true
        }
      },
      svg: {
        canvas: {
          height: function() {
            return $scope.size.height;
          },
          width: function() {
            return $scope.size.width;
          },
          fill: 'transparent'
        },
        elements: {
          background: {
            name: 'Background Colour',
            type: 'rect',
            height: function() {
              return $scope.size.height;
            },
            width: function() {
              return $scope.size.width;
            },
            fill: function() {
              return $scope.theme.background;
            },
            editable: {
              fill: 'picker'
            }
          },
          image: {
            name: 'Image',
            type: 'image',
            width: 600,
            height: function() {
              return this.width;
            },
            src: '',
            opacity: 1,
            x: '0%',
            y: '0%',
            preserveAspectRatio: 'xMinYMin meet',
            draggable: true,
            defaultFilter: '',
            editable: {
              src: true,
              width: true,
              opacity: true,
              filters: [
                'Sepia',
                'Grayscale',
                'Saturate',
                'Invert',
                'Blur'
              ],
            }
          },
          logo: {
            name: 'Logo',
            type: 'image',
            width: 100,
            // height: function() {
            //   return this.width/4;
            // },
            height: 100,
            opacity: 1,
            src: function() {
              return $scope.theme.logoSrc;
            },
             x: 10,
             y: 210,
//			x: function() {
//                return $scope.size.width - ($scope.size.gridSize * 3);
//              },
//            y: function() {
//                var h = ($scope.size.gridSize) / 2;
//                return $scope.size.height - (this.height() + h);
//              },
            preserveAspectRatio: 'xMinYMin meet',
            editable: {
              src: {
                'Blue': 'data:image/png;base64,',
                'Dark': 'data:image/png;base64,',
                'White': 'data:image/png;base64,'
              },
              width: true,
            },
            draggable: {
              x: true,
              y: true
            },
            showHoverArea: true
          },
          headline: {
            name: 'Headline',
            type: 'text',
            text: 'CardKit is a powerful, configurable\nimage editor, that can be run right\ninside your web browser.',
            fill: function() {
              return $scope.theme.quote;
            },
            fontSize: 40,
            fontFamily: function() {
              return $scope.theme.headlineFont;
            },
            fontWeight: 300,
            lineHeight: function() {
              return this.fontSize*1.2;
            },
            textAnchor: 'middle',
            x: '50%',
            y: 75,
            draggable: true,
            showHoverArea: true,
            editable: {
              text: true,
              fill: 'picker',
              textAnchor: true,
              fontSize: {
                'Small (18px)': 18,
                'Medium (26px)': 26,
                'Large (32px)': 32,
                'Extra Large (40px)': 40,
              },
            }
          },
          subtext: {
            name: 'Subtext',
            type: 'text',
            text: 'Created by The Times of London\nAvailable on GitHub at github.com/times/cardkit',
            fill: function() {
              return $scope.theme.quote;
            },
            fontSize: 18,
            lineHeight: 22,
            fontWeight: 300,
            fontFamily: function() {
              return $scope.theme.headlineFont;
            },
            textAnchor: 'middle',
            x: '50%',
            yAttach: {
              element: 'headline'
            },
            draggable: true,
            showHoverArea: true,
            editable: {
              text: true,
              fontSize: {
                'Small (12px)' : 12,
                'Medium (18px)': 18,
                'Large (22px)': 22,
                'Extra Large (36px)': 36,
              },
              fill: 'picker',
              textAnchor: true
            },
          }
        },
      }
    };

    function createConfigCopy() {
      $scope.defaultConfig = angular.copy($scope.config);
      $scope.$broadcast('resetSvg');
    }

    // Configure themes, set default
    if(typeof $scope.config.themes !== 'undefined') {
      var defaultTheme = $filter('filter')($scope.config.themes, {
        default: true
      }, true)[0];
      if(defaultTheme) {
        $scope.theme = defaultTheme;
      } else {
        $scope.theme = ($scope.config.themes.length > 1) ? null : $scope.config.themes[0];
      }
    }

    // Configure sizes, set default
    var defaultSize = $filter('filter')($scope.config.sizes, {
      default: true
    }, true)[0];
    if(defaultSize) {
      $scope.size = defaultSize;
    } else {
      $scope.size = ($scope.config.sizes.length > 1) ? null : $scope.config.sizes[0];
    }

    $scope.$watch('theme', function() {
      $scope.$broadcast('changeTheme');
      createConfigCopy();
    });

    $scope.$watch('size', function() {
      $scope.$broadcast('changeSize');
      createConfigCopy();
    });

    $scope.resetSvg = function() {
      $scope.config.svg = $scope.defaultConfig.svg
      createConfigCopy();
    };

    // Drop handler.
    $scope.onDrop = function (data, event, key) {
      var dataTransfer = getDataTransfer(event);
      readFile(dataTransfer.files[0], key);
    };

    $scope.fileChanged = function(file) {
      readFile(angular.element(file)[0].files[0], angular.element(file).data('key'));
    };

    /**
     * Read the supplied file (from DataTransfer API)
     */
    function readFile(file, key) {
      var reader = new FileReader();

      reader.onload = function() {
        $scope.config.svg.elements[key].src = reader.result;
        $scope.$apply();
      };

      reader.readAsDataURL(file);
    }

    /**
     * Gets the data transfer
     *
     * @param   {Event}   The data transfer event
     *
     * @return  The event's data transfer or null
     */
    function getDataTransfer(event) {
      event.stopPropagation();
      event.preventDefault();
      return event.dataTransfer || null;
    }

    /**
     * Slugifies the supplied string
     *
     * @param   {string}  text - The string to slugify
     *
     * @return  {string}  The slugified string
     */
    function slugify(text) {
      return text.toString().toLowerCase()
        .replace(/\s+/g, '-')           // Replace spaces with -
        .replace(/[^\w\-]+/g, '')       // Remove all non-word chars
        .replace(/\-\-+/g, '-')         // Replace multiple - with single -
        .replace(/^-+/, '')             // Trim - from start of text
        .replace(/-+$/, '');            // Trim - from end of text
    }

    /**
     * Finds the first element with 'useAsFilename' set to true, and returns the file name based on it's text value
     *
     * @return  string  The file name
     */
    function findFileName() {
      // Map elements object to an array
      var elementsArray = [];
      angular.forEach($scope.config.svg.elements, function(value){
        elementsArray.push(value);
      });

      // Filter to find the element that has `useAsFilename` set as true
      var fileNameElement = $filter('filter')(elementsArray, {
        useAsFilename: true,
        type: 'text'
      }, true)[0];

      // Default the title to 'image.png'
      var fileName = 'image.png';

      // If we found an appropriate element, set that as the title instead
      if(fileNameElement) {
        // We run `slugify()` here to make it an acceptable file name
        fileName = slugify(fileNameElement.text) + '.png';
      }

      // Return the filename
      return fileName;
    }

    $scope.removeImage = function(key) {
      $scope.config.svg.elements[key].src = '';
    };

    $scope.downloadSvg = function() {
      // Get the file name
      var fileName = findFileName();

      // Run the conversion and download
      saveSvgAsPng(document.getElementById('snap-svg'), fileName, {
        scale: $scope.config.output.scale
      });
    };
  });
